import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FeedbackDetailsPage = ({ id }) => {
  const [feedback, setFeedback] = useState(null);
  const [ratings, setRatings] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const [feedbackResponse, ratingsResponse] = await Promise.all([
          axios.get(`http://localhost:3000/feedback`),
          axios.get(`http://localhost:3000/ratings`)
        ]);

        console.log('Raw Feedback Response:', feedbackResponse.data);
        console.log('Raw Ratings Response:', ratingsResponse.data);

        setFeedback(feedbackResponse.data);
        setRatings(ratingsResponse.data);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(`Error fetching data: ${error.message}`);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [id]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (!feedback || !ratings) return <div>No feedback or ratings found</div>;

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    const date = new Date(dateString);
    return isNaN(date.getTime()) ? 'Invalid Date' : date.toLocaleDateString();
  };

  console.log('Processed Feedback:', feedback);
  console.log('Processed Ratings:', ratings);

  return (
    <div>
      <h1>Feedback Details</h1>
      <table>
        <tbody>
          <tr>
            <td>Institution Name:</td>
            <td>{feedback.institutionName || 'N/A'}</td>
          </tr>
          <tr>
            <td>Website:</td>
            <td>{feedback.website || 'N/A'}</td>
          </tr>
          <tr>
            <td>Visit Date:</td>
            <td>{formatDate(feedback.visitDate)}</td>
          </tr>
          <tr>
            <td>Staff Name:</td>
            <td>{feedback.staffName || 'N/A'}</td>
          </tr>
          <tr>
            <td>Staff Email:</td>
            <td>{feedback.staffEmail || 'N/A'}</td>
          </tr>
          <tr>
            <td>Staff Mobile:</td>
            <td>{feedback.staffMobile || 'N/A'}</td>
          </tr>
          <tr>
            <td>Total Students:</td>
            <td>{feedback.totalStudents || 'N/A'}</td>
          </tr>
          <tr>
            <td>Accompanying Staff:</td>
            <td>{feedback.accompanyingStaff || 'N/A'}</td>
          </tr>
        </tbody>
      </table>

      <h2>Ratings</h2>
      <table>
        <tbody>
          <tr>
            <td>IPR Rating:</td>
            <td>{ratings.iprRating || 'N/A'}</td>
          </tr>
          <tr>
            <td>FCIPT Rating:</td>
            <td>{ratings.fciptRating || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge:</td>
            <td>{ratings.knowledge || 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations IPR:</td>
            <td>{ratings.explanationsIPR || 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations FCIPT:</td>
            <td>{ratings.explanationsFCIPT || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge Before:</td>
            <td>{ratings.knowledgeBefore || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge After:</td>
            <td>{ratings.knowledgeAfter || 'N/A'}</td>
          </tr>
          <tr>
            <td>Technical Contents:</td>
            <td>{ratings.technicalContents || 'N/A'}</td>
          </tr>
          <tr>
            <td>Ease of Understanding:</td>
            <td>{ratings.easeOfUnderstanding || 'N/A'}</td>
          </tr>
        </tbody>
      </table>

      <h2>Additional Information</h2>
      <p>Sources: {feedback.sources?.join(', ') || 'N/A'}</p>
      <p>Campuses: {feedback.campuses?.join(', ') || 'N/A'}</p>
      <p>Best: {feedback.best || 'N/A'}</p>
      <p>Worst: {feedback.worst || 'N/A'}</p>
      <p>Suggestions: {feedback.suggestions || 'N/A'}</p>
      <p>Comments: {feedback.comments || 'N/A'}</p>

      <p>Created At: {formatDate(feedback.createdAt)}</p>
      <p>Updated At: {formatDate(feedback.updatedAt)}</p>
    </div>
  );
};

export default FeedbackDetailsPage;
